    period.  The transfers of the joint fundraising proceeds recived during a reporting
    period from or affiliates representss the commttee's share of proceeds for contributions
    received during this or prior reporting periods.  The memo entries for these contributions
    are included in this or prior reports of the committee.  The commitee owns the
    building."
